n = int(input())
p = []
for i in range(n):
	x, y = map(int, input().split())
	p.append((x, y))

p.sort()

def check(i):
	d = 0
	for j in range(n):
		if p[j][i]!= i:
			d += 1
	return d == 2

for i in range(n):
	if check(p[i][0]):
		break

for i in range(1, n):
	if check(p[i][1]):
		break

if not check(p[-1][0]):
	print("NO")
else:
	print("YES")
